import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
  <div className="app">
    <div className="user-info">
      <img src="https://avatars3.githubusercontent.com/u/35742444?v=4"></img>
      <h2>Pedro Pacheco</h2>
    </div>
  </div>;
};

export default App;
